import React from "react";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container  h-content">
      <div className="row ">
        <div className="col ">
          <p className="fs-1 text ">Contact Me</p>
        </div>
      </div>
      <div className="row bg-primary container-content">
        <div className="col  card-contact">
          <p className="pt-5"> Llameme o dejame un WHP</p>
          <div className="row">
            <div className="col-auto fs-2  text h-content d-flex justify-content-center align-items-center mx-4">
              <p>1132716458</p>
            </div>
            <div className="col m-1">
              <i className="bi bi-whatsapp"></i>
              <i className="bi bi-telephone-plus-fill"></i>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
